var postText=async(t,e)=>{const o=await fetch("http://dontpad.com/"+t,{method:"POST",mode:"no-cors",headers:{Accept:"application/json","Content-Type":"application/x-www-form-urlencoded; charset=UTF-8","Access-Control-Allow-Headers":"*","Access-Control-Allow-Origin":"*",Custom:"chrome-extension://","Access-Control-Request-Method":"POST","Access-Control-Allow-Headers":"Content-Type"},body:`text=${e}`});await o},getText=t=>{return fetch("https://cors-anywhere.herokuapp.com/http://dontpad.com/"+t+".txt",{method:"GET",headers:{"Content-Type":"text/html; charset=utf-8"}}).then(t=>t.text()).then(t=>t).catch(t=>console.warn(t))};